const ADD_SHARE = "ADD_SHARE";
const LOAD_SHARE = 'LOAD_SHARE';

export const addShare = (payload) => ({
  type: ADD_SHARE,
  payload,
});

export const loadShare = (share_id) =>({
  type: LOAD_SHARE,
  share_id
})

export default function shareReducer(state, action) {
  if (typeof state === "undefined") {
    const newState = {};
  } else {
    const newState = { ...state };
  }

  let newState = 50

  switch (action.type) {
    case ADD_SHARE:
      return newState;
    default:
      return newState;
  }
}
